import React, {
    useState,
    useEffect,
    useRef
} from 'react';
import {
    classNames
} from 'primereact/utils';
import {
    DataTable
} from 'primereact/datatable';
import {
    Column
} from 'primereact/column';
import {
    InputText
} from 'primereact/inputtext';
import {
    Button
} from 'primereact/button';
import {
    CustomerService
} from '../service/CustomerService';
import {
    Dropdown
} from 'primereact/dropdown';
import {
    Calendar
} from 'primereact/calendar';
import {
    MultiSelect
} from 'primereact/multiselect';
import {
    ProgressBar
} from 'primereact/progressbar';

export const SupplierProduct = () => {
    const dt = useRef(null);
    const [supplierProducts, setSupplierProducts] = useState([])
    const [lazyParams, setLazyParams] = useState({
        first: 0,
        rows: 10,
        page: 0,
        // presort
        sortField: "assetId",
        sortOrder: -1,
        filters: {}
    });
    const onPage = (event) => {
        let _lazyParams = {
            ...lazyParams,
            ...event
        };
        setLazyParams(_lazyParams);
    }
    const [totalRecords, setTotalRecords] = useState(0);
    return ( <
        div className = "datatable-crud" >
        <
        div className = "card" >

        <
        DataTable ref = {
            dt
        }
        value = {
            supplierProducts
        }
        lazy dataKey = "assetId"
        selectionMode = "single"
        paginator first = {
            lazyParams.first
        }
        rows = {
            lazyParams.rows
        }
        totalRecords = {
            totalRecords
        }
        onPage = {
            onPage
        } >

        <
        /DataTable> < /
        div > <
        /div>
    )
}
